import { Component } from "react";

export class SignUp extends Component {
    state = {
        login: "",
        password: "",
        name: ""
    }

    LoginClick =({clogin, cpassword, cname}) => {
        this.setState({
            login: clogin,
            password: cpassword,
            name: cname
        }) 
    }

    render () {
        return (
            <>
                <div>
                    <label>логин</label>
                    <input name="логин"/>
                </div>
                <div>
                    <label>пароль</label>
                    <input name="password"/>
                </div>
                <div>
                    <label>имя игрока/никнейм</label>
                    <input name="name"/>
                </div>
                <button>Зарегистироваться</button>
            </>
        )
    }
}
